import React from 'react';
import './App.css';
import {createMuiTheme,ThemeProvider,CssBaseline,Divider} from '@material-ui/core'

import BodyArea from './Layout/BodyArea';
import Header from './Layout/Header'
import Footer from './Layout/Footer'
import LoginSignupDialog from  './Dialogs/LoginSignupDialog'

const theme = createMuiTheme({
  palette:{
    type:'dark'
  },
  typography: {
    button: {
      textTransform: 'none'
    }
  }
});

export default function App(){
  const handleClickLoginOpen = () => {
    console.log("login button is clicked")
  };

  const handleClickSignupOpen = () => {
    console.log("signup button is clicked")
  };
  return(
    <div className="App">
      <ThemeProvider theme={theme}>
      <CssBaseline />
      <Header loginOpen={handleClickLoginOpen} signupOpen={handleClickSignupOpen}/>
      <Divider />
      <BodyArea/>    
      <Footer/>
      <LoginSignupDialog isActive={true}/>  
      </ThemeProvider> 

    </div>
  );
}
